import { ThemeProvider, Box, Container } from 'theme-ui';
import theme from 'theme';
import Layout from 'components/layout';
import BannerSecundario from 'sections/bannerSecundario';
import banner from 'assets/images/banner1.png';
import { useInformacoes } from 'hooks/useInformacoes';
import { slugify } from 'services/slugify';

export default function Noticia({ obrigacao }) {
  const { obrigacoes } = useInformacoes()
  const obrEstado = obrigacoes[obrigacao.slug]
  obrEstado ? ( 
    console.log('deu certo')
  ) : (
    console.log('else')
  )

  return (
    <ThemeProvider theme={theme}>
      <Layout>
        <BannerSecundario title='teste' banner={banner} />
        <Box as="section" id="services" sx={styles.section}>
          <Container>
            {/* <Box as="div" dangerouslySetInnerHTML={{ __html: noticiaAtual?.mn_texto }} /> */}
          </Container>
        </Box>
      </Layout>
    </ThemeProvider>
  );
}

const styles = {
  section: {
    pt: [8, null, null, null, 10, 12],
    pb: [12, null, null, null, null, 15],
  },
};

export const getStaticPaths = async () => {
  return {
    paths: [],
    fallback: 'blocking'
  }
}

export const getStaticProps = async ({ params }) => {
  const { slug } = params
  return {
    props: {
      obrigacao: { slug }
    }
  }
}
